import './App.css';

const Task = (value) => {
  const tasks = ['Exame','Contadora','Curtida insta ropi','Estudar'];
  return (
    <div>
      {tasks.map((task)=> <li>{task}</li>)}
    </div>
  );
}

function App() {
  return (

    <Task />
  );
}

export default App;
